After initializing the LED dimming driver, we can use the APIs provided by the light_driver component to control the LED lights. Combined with the button driver, the LED lights can be turned on/off through a button. Here, we will focus on controlling the on/off status, the color, and the color temperature. (1) On/off status The following API can be used to control the on/off status of the LED lights. //Turn on the light
light_driver_set_switch(true);
//Turn off the light
light_driver_set_switch(false); (2) Color After initializing the LED dimming driver and turning on the lights, the color of the LEDs can be controlled based on RGB, HSL, or HSV color spaces. When using LED dimming APIs, pay attention to the parameter value range of these APIs: HSV: Hue ≤ 360, Saturation ≤ 100, Value ≤ 100. HSL: Hue ≤ 360, Saturation ≤ 100, Lightness ≤ 100. RGB: Red ≤ 255, Green ≤ 255, Blue ≤ 255. The following APIs are used for adjusting all three components of RGB, HSL, or HSV color space in one call. You can also adjust only one component using APIs listed in Table 6.1. //RGB color control
light_driver_set_rgb(uint8_t red, uint8_t green, uint8_t blue);
//HSL color control
light_driver_set_hsl(uint16_t hue, uint8_t saturation, uint8_t lightness);
//HSV color control
light_driver_set_hsv(uint16_t hue, uint8_t saturation, uint8_t value); (3) Color temperature In addition to controlling the on/off status and color, light_driver APIs can also be used to control the color temperature (but not available for simulated lights). The following API can be used to change the color temperature and brightness: light_driver_set_ctb(uint8_t color_temperature, uint8_t brightness); 📝 Source code Please refer to book-esp32c3-iot-projects/device_firmware/2_light_drivers for the complete code to add the LED dimming driver and the button driver to the smart light project. You can also check the running results after compiling the code and flashing it onto the development board.

