Wi-Fi event handling This module takes care of Wi-Fi connection, disconnection, reconnection, scanning, etc., as detailed in the sections before. Additionally, when the WIFI_EVENT_STA_START event occurs, it will also create a SmartConfig task. NETIF event handling This module helps acquire the IP address. Details are provided in the sections before. When the IP_EVENT_STA_GOT_IP event occurs, the connection flag will be set. SmartConfig event handling The received request determines how the event is handled and processed. SmartConfig events are shown in Table 7.6. Table 7.6. SmartConfig events Event Description SC_EVENT_SCAN_DONE Scan to obtain the information about nearby APs SC_EVENT_FOUND_CHANNEL Get the channel of the target AP SC_EVENT_GOT_SSID_PSWD Enter STA mode to get the SSID and password of the target AP SC_EVENT_SEND_ACK_DONE Set the SmartConfig completion flag SmartConfig tasks The code for SmartConfig tasks is as follows. static void smartconfig_example_task (void *param)
{ EventBits_t uxBits; ESP_ERROR_CHECK(esp_smartconfig_set_type(SC_TYPE_ESPTOUCH)); smartconfig_start_config_t cfg = SMARTCONFIG_START_CONFIG_DEFAULT(); ESP_ERROR_CHECK(esp_smartconfig_start(&cfg)); while (1) { uxBits = xEventGroupWaitBits (s_wifi_event_group, CONNECTED_BIT | ESPTOUCH_DONE_BIT, true, false, portMAX_DELAY); if (uxBits & CONNECTED_BIT) { ESP_LOGI (TAG, "WiFi Connected to ap"); } if (uxBits & ESPTOUCH_DONE_BIT) { ESP_LOGI (TAG, "smartconfig over"); esp_smartconfig_stop(); vTaskDelete (NULL); } }
} As demonstrated in the code above, a SmartConfig task primarily performs three functions. First, it sets the SmartConfig type, such as ESP-TOUCH and ESP-TOUCH V2. Second, after the configuration, it enables SmartConfig by calling esp_smartconfig_start(). Finally, it checks the event group in a loop. Upon receiving the SC_EVENT_SEND_ACK_DONE event, it stops SmartConfig by calling esp_smartconfig_stop(). Main program It creates an event group to set the flag when a relevant event is triggered, and then initialises Wi-Fi.

