📝 Source code For the source code of the function esp_send_broadcast(), please refer to book-esp32c3-iot-projects/test_case/broadcast_discovery . The function esp_send_broadcast() sends UDP broadcast packets with the data "Are you Espressif IOT Smart Light" to the LAN, and then waits for the peer to reply. This function uses the standard interface of Berkeley sockets, also known as BSD socket. Berkeley socket is a common network interface in UNIX systems, which not only supports different network types, but also is a communication mechanism between internal processes. The TCP/UDP network programming covered in this book applies Berkeley sockets. If you are interested, you can read the UNIX Network Programming (Volume 1): Socket Networking API published by Posts & Telecommunications Press to learn more about Berkeley socket programming. In this book, we will only briefly introduces how to use socket programming. In this section, we will introduce how to use socket(AF_INET, SOCK_DGRAM, 0) to create a UDP socket, and then use setsockopt() to enable socket support for broadcasting. Then we will set the destination address for broadcasting to all 255 and the port to 3333, and call sendto()to send the message. You can determine whether the data is sent successfully according to the return value of the sendto() function. The code is as below: esp_err_t esp_send_broadcast(void)
{ int opt_val = 1; esp_err_t err = ESP_FAIL; struct sockaddr_in from_addr = {0}; socklen_t from_addr_len = sizeof(struct sockaddr_in); char udp_recv_buf[64 + 1] = {0}; //Create an IPv4 UDP socket int sockfd = socket(AF_INET, SOCK_DGRAM, 0); if (sockfd == -1) { ESP_LOGE(TAG, "Create UDP socket fail"); return err; } //Set SO_BROADCAST socket option, and use it to send broadcast int ret = setsockopt(sockfd, SOL_SOCKET, SO_BROADCAST, &opt_val, sizeof(int)); if (ret < 0) { ESP_LOGE(TAG, "Set SO_BROADCAST option fail"); goto exit; } //Set broadcast destination address and port struct sockaddr_in dest_addr = { .sin_family = AF_INET, .sin_port = htons(3333), .sin_addr.s_addr = htonl(INADDR_BROADCAST), }; char *broadcast_msg_buf = "Are you Espressif IOT Smart Light"; //Call sendto() to send broadcast data ret = sendto(sockfd, broadcast_msg_buf, strlen(broadcast_msg_buf), 0, (struct sockaddr *)&dest_addr, sizeof(struct sockaddr)); if (ret < 0) { ESP_LOGE(TAG, "Error occurred during sending: errno %d", errno); } else { ESP_LOGI(TAG, "Message sent successfully"); ret = recvfrom(sockfd, udp_recv_buf, sizeof(udp_recv_buf) - 1, 0, (struct sockaddr *)&from_addr, (socklen_t *)&from_addr_len); if (ret > 0) { ESP_LOGI(TAG, "Receive udp unicast from %s:%d, data is %s", inet_ntoa (((struct sockaddr_in *)&from_addr)->sin_addr), ntohs(((struct sockaddr_in *)& from_addr)->sin_port), udp_recv_buf); err = ESP_OK; } }
exit: close(sockfd); return err;
}

