📝 Source code For the source code of the function esp_receive_broadcast(), please refer to book-esp32c3-iot-projects/test_case/broadcast_discovery . The function esp_receive_broadcast() implements reception of broadcast packets and unicast replies. The implementation logic of a receiver is same as that of the sender. First create a UDP socket, and set the source address and port number of the message to be listened. Generally, it is used as a server. The source address of the message is set to 0.0.0.0, which means that the source address of the message is not verified. Call bind() to bind the socket, and then use recvfrom() to receive the message. When a broadcast packet carrying the data "Are you Espressif IOT Smart Light" is received, the IP address and port number of the peer are saved in from_addr, which will be sent to the peer in the form of unicast. The code is as below: esp_err_t esp_receive_broadcast(void)
{ esp_err_t err = ESP_FAIL; struct sockaddr_in from_addr = {0}; socklen_t from_addr_len = sizeof(struct sockaddr_in); char udp_server_buf[64+1] = {0}; char *udp_server_send_buf = "ESP32-C3 Smart Light https 443"; //Create an IPv4 UDP socket int sockfd = socket(AF_INET, SOCK_DGRAM, 0); if (sockfd == -1) { ESP_LOGE(TAG, "Create UDP socket fail"); return err; } //Set broadcast destination address and port struct sockaddr_in server_addr = { .sin_family = AF_INET, .sin_port = htons(3333), .sin_addr.s_addr = htonl(INADDR_ANY), }; int ret = bind(sockfd, (struct sockaddr *)&server_addr, sizeof(server_addr)); if (ret < 0) { ESP_LOGE(TAG, "Bind socket fail"); goto exit; } //Call recvfrom()to receive broadcast data while (1) { ret = recvfrom(sockfd, udp_server_buf, sizeof(udp_server_buf) - 1, 0, (struct sockaddr *)&from_addr, (socklen_t *)&from_addr_len); if (ret > 0) { ESP_LOGI(TAG, "Receive udp broadcast from %s:%d, data is %s", inet_ntoa (((struct sockaddr_in *)&from_addr)->sin_addr), ntohs(((struct sockaddr_in *)& from_addr)->sin_port),udp_server_buf); //Upon reception of broadcast request, send data communication port of peer through unicast if (!strcmp(udp_server_buf, "Are you Espressif IOT Smart Light")){ ret = sendto(sockfd, udp_server_send_buf, strlen(udp_server_send_buf), 0, (struct sockaddr *)&from_addr, from_addr_len); if (ret < 0) { ESP_LOGE(TAG, "Error occurred during sending: errno %d", errno); } else { ESP_LOGI(TAG, "Message sent successfully"); } } }
}
exit: close(sockfd); return err;
}

