📝 Source code For the source code of the function esp_join_multicast_group(), please refer to book-esp32c3-iot-projects/test_case/multicast_discovery . The implementation of multicast sending is more complex than that of broadcast sending. Multicast sending requires setting the sending interface of the multicast packets. If you need to receive packets from a certain multicast group, you also need to join the multicast group. The function esp_join_multicast_group() implements the setting of the multicast group sending interface and the function of joining the multicast group. The function esp_send_multicast() implements the creation, binding, configuration of destination address and port of regular UDP sockets, and sending and receiving functions. In addition, TTL settings are also added to ensure that the multicast group can only be performed in the LAN of this route. The code is as below: #define MULTICAST_IPV4_ADDR "232.10.11.12"
int esp_join_multicast_group(int sockfd)
{ struct ip_mreq imreq = { 0 }; struct in_addr iaddr = { 0 }; int err = 0; //Configure sending interface of multicast group esp_netif_ip_info_t ip_info = { 0 }; err = esp_netif_get_ip_info(esp_netif_get_handle_from_ifkey("WIFI_STA_DEF"), &ip_info); if (err ! = ESP_OK) { ESP_LOGE(TAG, "Failed to get IP address info. Error 0x%x", err); goto err; } inet_addr_from_ip4addr(&iaddr, &ip_info.ip); err = setsockopt(sockfd, IPPROTO_IP, IP_MULTICAST_IF, &iaddr, sizeof(struct in_addr)); if (err < 0) { ESP_LOGE(TAG, "Failed to set IP_MULTICAST_IF. Error %d", errno); goto err; } //Configure the address of monitoring multicast group inet_aton(MULTICAST_IPV4_ADDR, &imreq.imr_multiaddr.s_addr); //Configure the socket to join the multicast group err = setsockopt(sockfd, IPPROTO_IP, IP_ADD_MEMBERSHIP, &imreq, sizeof(struct ip_mreq)); if (err < 0) { ESP_LOGE(TAG, "Failed to set IP_ADD_MEMBERSHIP. Error %d", errno); }
err: return err;
} esp_err_t esp_send_multicast(void)
{ esp_err_t err = ESP_FAIL; struct sockaddr_in saddr = {0}; struct sockaddr_in from_addr = {0}; socklen_t from_addr_len = sizeof(struct sockaddr_in); char udp_recv_buf[64 + 1] = {0}; //Create an IPv4 UDP socket int sockfd = socket(AF_INET, SOCK_DGRAM, 0); if (sockfd == -1) { ESP_LOGE(TAG, "Create UDP socket fail");` return err; } //Bind socket saddr.sin_family = PF_INET; saddr.sin_port = htons(3333); saddr.sin_addr.s_addr = htonl(INADDR_ANY); int ret = bind(sockfd, (struct sockaddr *)&saddr, sizeof(struct sockaddr_in)); if (ret < 0) { ESP_LOGE(TAG, "Failed to bind socket. Error %d", errno); goto exit; } //Set multicast TTL to 1, limiting the multicast packet to one route uint8_t ttl = 1; ret = setsockopt(sockfd, IPPROTO_IP, IP_MULTICAST_TTL, &ttl, sizeof(uint8_t)); if (ret < 0) { ESP_LOGE(TAG, "Failed to set IP_MULTICAST_TTL. Error %d", errno); goto exit; } //Join the multicast group ret = esp_join_multicast_group(sockfd); if (ret < 0) { ESP_LOGE(TAG, "Failed to join multicast group"); goto exit; } //Set multicast destination address and port struct sockaddr_in dest_addr = { .sin_family = AF_INET, .sin_port = htons(3333), }; inet_aton(MULTICAST_IPV4_ADDR, &dest_addr.sin_addr.s_addr); char *multicast_msg_buf = "Are you Espressif IOT Smart Light"; //Call sendto() to send multicast data ret = sendto(sockfd, multicast_msg_buf, strlen(multicast_msg_buf), 0, (struct sockaddr *)&dest_addr, sizeof(struct sockaddr)); if (ret < 0) { ESP_LOGE(TAG, "Error occurred during sending: errno %d", errno); } else { ESP_LOGI(TAG, "Message sent successfully"); ret = recvfrom(sockfd, udp_recv_buf, sizeof(udp_recv_buf) - 1, 0, (struct sockaddr *)&from_addr, (socklen_t *)&from_addr_len); if (ret > 0) { ESP_LOGI(TAG, "Receive udp unicast from %s:%d, data is %s", inet_ntoa(((struct sockaddr_in *)&from_addr)->sin_addr), ntohs(((struct sockaddr_in *)&from_addr)->sin_port), udp_recv_buf); err = ESP_OK; } }
exit: close(sockfd); return err;
}

