📝 Source code For the source code of the function esp_recv_multicast(), please refer to book-esp32c3-iot-projects/test_case/multicast_discovery . Implementing a multicast receiver is similar to implementing a multicast sender, which requires specifying the interface of multicast packets and the multicast group to be joined. The function esp_recv_multicast() implements the creation, binding, configuration of destination address and port of regular UDP sockets, and sending and receiving functions. In addition, since multicast needs to be sent in this example, Time To Live (TTL) is set. The code is as below: esp_err_t esp_recv_multicast(void)
{ esp_err_t err = ESP_FAIL; struct sockaddr_in saddr = {0}; struct sockaddr_in from_addr = {0}; socklen_t from_addr_len = sizeof(struct sockaddr_in); char udp_server_buf[64+1] = {0}; char *udp_server_send_buf = "ESP32-C3 Smart Light https 443"; //Create an IPv4 UDP socket int sockfd = socket(AF_INET, SOCK_DGRAM, 0); if (sockfd == -1) { ESP_LOGE(TAG, "Create UDP socket fail"); return err; } //Bind socket saddr.sin_family = PF_INET; saddr.sin_port = htons(3333); saddr.sin_addr.s_addr = htonl(INADDR_ANY); int ret = bind(sockfd, (struct sockaddr *)&saddr, sizeof(struct sockaddr_in)); if (ret < 0) { ESP_LOGE(TAG, "Failed to bind socket. Error %d", errno); goto exit; } //Set multicast TTL to 1, limiting the multicast packet to one route uint8_t ttl = 1; ret = setsockopt(sockfd, IPPROTO_IP, IP_MULTICAST_TTL, &ttl, sizeof(uint8_t)); if (ret < 0) { ESP_LOGE(TAG, "Failed to set IP_MULTICAST_TTL. Error %d", errno); goto exit; } //Join the multicast group ret = esp_join_multicast_group(sockfd); if (ret < 0) { ESP_LOGE(TAG, "Failed to join multicast group"); goto exit; } //Call recvfrom() to receive multicast data while (1) { ret = recvfrom(sockfd, udp_server_buf, sizeof(udp_server_buf) - 1, 0, (struct sockaddr *)&from_addr, (socklen_t *)&from_addr_len); if (ret > 0) { ESP_LOGI(TAG, "Receive udp multicast from %s:%d, data is %s", inet_ntoa (((struct sockaddr_in *)&from_addr)->sin_addr), ntohs(((struct sockaddr_in *)& from_addr)->sin_port), udp_server_buf); //Upon reception of multicast request, send data communication port of peer through unicast if (!strcmp(udp_server_buf, "Are you Espressif IOT Smart Light")) { ret = sendto(sockfd, udp_server_send_buf, strlen(udp_server_send_buf), 0, (struct sockaddr *)&from_addr, from_addr_len); if (ret < 0) { ESP_LOGE(TAG, "Error occurred during sending: errno %d", errno); } else { ESP_LOGI(TAG, "Message sent successfully"); } } } }
exit: close(sockfd); return err;
}

