{ char *host_name = "my_smart_light"; char *instance_name = "esp32c3_smart_light"; //Initialise the mDNS component if (mdns_init() ! = ESP_OK) { ESP_LOGE(TAG, "mdns_init fail"); return ESP_FAIL; } //Set host name (the DNS domain name tag to be queried by other hosts) if (mdns_hostname_set(host_name) ! = ESP_OK) { ESP_LOGE(TAG, "mdns_hostname_set fail"); goto err; } ESP_LOGI(TAG, "mdns hostname set to: [%s]", host_name); //Set mDNS instance name to be discovered by mDNS LAN if (mdns_instance_name_set(instance_name) ! = ESP_OK) { ESP_LOGE(TAG, "mdns_instance_name_set fail"); goto err; } //Set service TXT field data (optional) mdns_txt_item_t serviceTxtData[1] = { {"board", "esp32c3"} }; //Add HTTP service; port 80 corresponds to mDNS service. //The second parameter (application layer protocol) and the third parameter (transport layer protocol) need to correspond to each other. if (mdns_service_add(instance_name, "_http", "_tcp", 80, serviceTxtData, 1) ! = ESP_OK) { ESP_LOGE(TAG, "mdns_instance_name_set fail"); goto err; } //Set service TXT field data if (mdns_service_txt_item_set("_http", "_tcp", "path", "/foobar") ! =ESP_OK){ ESP_LOGE(TAG, "mdns_service_txt_item_set fail"); goto err; } return ESP_OK;
