📝 Source code For the source code of the function esp_create_tcp_client(), please refer to book-esp32c3-iot-projects/test_case/tcp_socket . The function esp_create_tcp_client() can create a TCP connection between a TCP client and a server, including creating of a TCP socket, configuring the destination address and port, connecting, and sending data. The code is as below: #define HOST_IP "192.168.3.80"
#define PORT 3333 esp_err_t esp_create_tcp_client(void)
{ esp_err_t err = ESP_FAIL; char *payload = "Open the light"; struct sockaddr_in dest_addr; dest_addr.sin_addr.s_addr = inet_addr(HOST_IP); dest_addr.sin_family = AF_INET; dest_addr.sin_port = htons(PORT); //Create a TCP socket int sock = socket(AF_INET, SOCK_STREAM, 0); if (sock < 0) { ESP_LOGE(TAG, "Unable to create socket: errno %d", errno); return err; } ESP_LOGI(TAG, "Socket created, connecting to %s:%d", HOST_IP, PORT); //Connect to the TCP server int ret = connect(sock, (struct sockaddr *)&dest_addr, sizeof(dest_addr)); if (ret ! = 0) { ESP_LOGE(TAG, "Socket unable to connect: errno %d", errno); close(sock); return err; } ESP_LOGI(TAG, "Successfully connected"); //Send TCP data ret = send(sock, payload, strlen(payload), 0); if (ret < 0) { ESP_LOGE(TAG, "Error occurred during sending: errno %d", errno); goto exit; } err = ESP_OK;
exit: shutdown(sock, 0); close(sock); return err;
} After the client establishes a TCP connection with the server, it sends the TCP data "Open the light" to the server. In addition to using TCP sockets, the client can also use TCP debugging tools to simulate the client for TCP connection. Based on the above TCP client and server code, and combined with the requirement of controlling the smart light through a smartphone, you can implement code of TCP server on the smart light device and code of TCP client on the smartphone. After establishing a TCP connection between the smartphone and the smart light, the smartphone can send data. For example, in the above code, the TCP client sends the data "Open the light"; and after the smart light receives the data, it can turn on the light by pulling up the GPIO pin level of the smart light.

