📝 Source code For the source code of the function esp_start_webserver(), please refer to book-esp32c3-iot-projects/test_case/https_server . The function esp_start_webserver() can create an HTTP server. The callback functions corresponding to the GET and POST operations on the server side are defined as esp_light_get_handler() and esp_light_set_handler() respectively, and must be registered through the function httpd_register_uri_handler() after calling the function httpd_start() on the server side. char buf[100] = "{\\"status\\": true}";
//Callback function of the HTTP GET request
esp_err_t esp_light_get_handler(httpd_req_t *req)
{ //Send data in JSON containing the status of smart lights to the client httpd_resp_send(req, buf, strlen(buf)); return ESP_OK;
} //Callback function of the HTTP POST request
esp_err_t esp_light_set_handler(httpd_req_t *req)
{ int ret, remaining = req->content_len; memset(buf, 0 , sizeof(buf)); while (remaining > 0) { //Read HTTP request data if ((ret = httpd_req_recv(req, buf, remaining)) <= 0) { if (ret == HTTPD_SOCK_ERR_TIMEOUT) { continue; } return ESP_FAIL; } remaining -= ret; } ESP_LOGI(TAG, "%.*s", req->content_len, buf); //TODO: Read and parse the data; then control the smart light return ESP_OK;
} //Callback function corresponding to GET
static const httpd_uri_t status = { .uri = "/light", .method = HTTP_GET, .handler = esp_light_get_handler,
}; //Callback function corresponding to POST
static const httpd_uri_t ctrl = { .uri = "/light", .method = HTTP_POST, .handler = esp_light_set_handler,
}; esp_err_t esp_start_webserver()
{ httpd_handle_t server = NULL; httpd_config_t config = HTTPD_DEFAULT_CONFIG(); config.lru_purge_enable = true; //Start the HTTP server ESP_LOGI(TAG, "Starting server on port: '%d'", config. server_port); if (httpd_start(&server, &config) == ESP_OK) { //Set the callback function corresponding to the HTTP URI ESP_LOGI(TAG, "Registering URI handlers"); httpd_register_uri_handler(server, &status); httpd_register_uri_handler(server, &ctrl); return ESP_OK; } ESP_LOGI(TAG, "Error starting server!" ); return ESP_FAIL;
} The above code implements an HTTP server for querying and setting the status of the smart light. When accessing http://[ip]/light through a browser, the browser will return {"status": true} (as shown in Figure 8.4) or {"status": false} to indicate the status of the smart light. Figure 8.4. Using HTTP to query the status of the smart light Press F12 on the current page to enter the Console. Enter the following command and press "Enter" to send a POST request. $ var xhr = new XMLHttpRequest();
