📝 Source code For the source code of the function esp_create_udp_server(), please refer to book-esp32c3-iot-projects/test_case/udp_socket . Creating a UDP server using socket is similar to creating a multicast group receiver as introduced in subsection 8.2.2. Both involve creating a UDP socket, configuring the bound port, and receiving and sending data. The function esp_create_udp_server() sets the SO_REUSEADDR option, allowing the server to bind the address of the already established connection. The code is as below: esp_err_t esp_create_udp_server(void)
{ char rx_buffer[128]; char addr_str[32]; esp_err_t err = ESP_FAIL; struct sockaddr_in server_addr; //Create a UDP socket int sock = socket(AF_INET, SOCK_DGRAM, 0); if (sock < 0) { ESP_LOGE(TAG, "create socket error"); return err; } ESP_LOGI(TAG, "create socket success, sock : %d", sock); //Enable SO_REUSEADDR, allowing the server to bind connected address int opt = 1; int ret = setsockopt(sock, SOL_SOCKET, SO_REUSEADDR, &opt, sizeof(opt)); if (ret < 0) { ESP_LOGE(TAG, "Failed to set SO_REUSEADDR. Error %d", errno); goto exit; } //Bind the server to an interface with all-zero IP address and port number 3333 server_addr.sin_family = AF_INET; server_addr.sin_addr.s_addr = INADDR_ANY; server_addr.sin_port = htons(PORT); ret = bind(sock, (struct sockaddr *) &server_addr, sizeof(server_addr)); if (ret < 0) { ESP_LOGE(TAG, "bind socket failed, socketfd: %d, errno : %d", sock, errno); goto exit; } ESP_LOGI(TAG, "bind socket success"); while (1) { struct sockaddr_in source_addr; socklen_t addr_len = sizeof(source_addr); memset(rx_buffer, 0, sizeof(rx_buffer)); int len = recvfrom(sock, rx_buffer, sizeof(rx_buffer) - 1, 0, (struct sockaddr *)&source_addr, &addr_len); // Reception error if (len < 0) { ESP_LOGE(TAG, "recvfrom failed: errno %d", errno); break; } else { //Data is received if (source_addr. sin_family == PF_INET) { inet_ntoa_r(((struct sockaddr_in *)&source_addr)->sin_addr, addr_str, sizeof(addr_str) - 1); } //String ends with NULL rx_buffer[len] = 0; ESP_LOGI(TAG, "Received %d bytes from %s:" , len, addr_str); ESP_LOGI(TAG, "%s", rx_buffer); } }
exit: close(sock); return err;
}

