📝 Source code For the source code of the function esp_create_udp_client(), please refer to book-esp32c3-iot-projects/test_case/udp_socket . With the function esp_create_udp_client(), the UDP client can send data, including creating UDP sockets, configuring destination addresses and ports, calling socket interface sendto() to send data. The code is as below: esp_err_t esp_create_udp_client(void)
{ esp_err_t err = ESP_FAIL; char *payload = "Open the light"; struct sockaddr_in dest_addr; dest_addr.sin_addr.s_addr = inet_addr(HOST_IP); dest_addr.sin_family = AF_INET; dest_addr.sin_port = htons(PORT); //Create a UDP socket int sock = socket(AF_INET, SOCK_DGRAM, 0); if (sock < 0) { ESP_LOGE(TAG, "Unable to create socket: errno %d", errno); return err; } //Send data int ret = sendto(sock, payload, strlen(payload), 0, (struct sockaddr *)&dest_addr, sizeof(dest_addr)); if (ret < 0) { ESP_LOGE(TAG, "Error occurred during sending: errno %d", errno); goto exit; } ESP_LOGI(TAG, "Message send successfully"); err = ESP_OK;
exit: close(sock); return err;
} UDP clients do not need to establish a connection with the server, and can directly send data to the server. Since UDP creates unreliable connections, the data sent, such as "Open the light," may be lost, causing the peer to fail to receive it. Therefore, when writing code for the client and server, some logic should be added to the application layer code to ensure that data is not lost. For example, when the client sends "Open the light" to the server, the server returns "Open the light OK" after receiving it successfully. If the client receives the data within 1 second, it means that the data has been sent to the server correctly. If the client does not receive it within 1 second, it needs to send the data "Open the light" again.

