HTTPS, namely HTTP over SSL, encrypts HTTP data through the SSL or TLS protocol. Compared with HTTP, HTTPS can prevent data from being stolen or changed during transmission, thus ensuring data integrity. Section 8.3.2 introduces how to use ESP-IDF to create an HTTP server. In fact, creating an HTTPS server is similar. Call httpd_ssl_start() to start the HTTP+TLS service, and call httpd_register_uri_handler() to register the corresponding callback function. 📝 Source code For the source code of functions httpd_ssl_start() and httpd_register_uri_handler(), please refer to book-esp32c3-iot-projects/test_case/https_server . static esperr_t root_get_handler(httpd_req_t *req)
{ httpd_resp_set_type(req, "text/html"); httpd_resp_send(req, "<h1>Hello Secure World! </h1>", HTTPD_RESP_USE_STRLEN); return ESP_OK;
} static const httpd_uri_t root = { .uri = "/", .method = HTTP_GET, .handler = root_get_handler
}; esp_err_t esp_create_https_server(void)
{ httpd_handle_t server = NULL; ESP_LOGI(TAG, "Starting server"); httpd_ssl_config_t conf = HTTPD_SSL_CONFIG_DEFAULT(); //Configure CA certificate and private key for the server extern const unsigned char cacert_pem_start[] asm("_binary_cacert_pem_start"); extern const unsigned char cacert_pem_end[] asm("_binary_cacert_pem_end"); conf.cacert_pem = cacert_pem_start; conf.cacert_len = cacert_pem_end - cacert_pem_start; extern const unsigned char prvtkey_pem_start[] asm("_binary_prvtkey_pem_start"); extern const unsigned char prvtkey_pem_end[] asm("_binary_prvtkey_pem_end"); conf.prvtkey_pem = prvtkey_pem_start; conf.prvtkey_len = prvtkey_pem_end - prvtkey_pem_start; //Start the HTTP+TLS server esp_err_t ret = httpd_ssl_start(&server, &conf); if (ESP_OK ! = ret) { ESP_LOGI(TAG, "Error starting server!" ); return ESP_FAIL; } //Set URI callback function ESP_LOGI(TAG, "Registering URI handlers"); httpd_register_uri_handler(server, &root); return ESP_OK;
} The above code provides an example of how to create an HTTPS server. Before using this code, please manually create a CA certificate and a private key in the main directory using the following command: $ openssl req -newkey rsa:2048 -nodes -keyout prvtkey.pem -x509 -days 3650 -out cacert.pem -subj "/CN=ESP32 HTTPS server example" Then modify the MakeLists.txt file to compile the certificate into the code. idf_component_register(SRCS "station_example_main.c" INCLUDE_DIRS "." EMBED_TXTFILES "cacert.pem" "prvtkey.pem") In addition, you also need to go to idf.py menuconfig → Component config → ESP HTTPS server, and configure CONFIG_ESP_HTTPS_SERVER_ENABLE. Enter https://[your device IP]:443/ in the Chrome browser. The CA certificate on the server side is not issued by a certification authority, thus it is not trusted. Therefore, you will see the screen shown in Figure 8.16. Figure 8.16. Interface of untrusted HTTPS connection Users need to click the "Advanced" button to allow this untrusted connection. Figure 8.17 shows the interface of a successful HTTPS connection. Figure 8.17. Interface of successful HTTPS connection Should you encounter a "Header fields are too long for server to interpret" message, just go to idf.py menuconfig → Component config → HTTP Server → Max HTTP Request Header Length, and increase HTTPD_MAX_REQ_HDR_LEN. Figure 8.18 shows the interface where the HTTPS connection fails. Figure 8.18. Interface of HTTPS connection failure

