The following example introduces how to create a CoAP+DTLS server. This example is actually the same as the CoAP example introduced in Section 8.3.4, except that two functions are added to support the DTLS protocol. The function coap_context_set_psk() is used to set the PSK encryption key in the DTLS protocol, and can also use certificate (PKI) for the DTLS protocol handshake. The coap_new_endpoint(ctx, &serv_addr, COAP_PROTO_DTLS) function indicates that the node supports the DTLS protocol. 📝 Source code For the complete example code of coap_context_set_psk(), please refer to book-esp32c3-iot-projects/test_case/coap . For instructions on how to use PKI, please see esp-idf/examples/protocols/coap_server . static char psk_key[] = "esp32c3_key";
static void esp_create_coaps_server(void)
{ coap_context_t *ctx = NULL; coap_address_t serv_addr; coap_resource_t *resource = NULL; while (1) { coap_endpoint_t *ep = NULL; unsigned wait_ms; //Create a CoAP server socket coap_address_init(&serv_addr); serv_addr.addr.sin6.sin6_family = AF_INET6; serv_addr.addr.sin6.sin6_port = htons(COAP_DEFAULT_PORT); //Create CoAP ctx ctx = coap_new_context(NULL); if (!ctx) { ESP_LOGE(TAG, "coap_new_context() failed"); continue; } //Add PSK encryption key coap_context_set_psk(ctx, "CoAP", (const uint8_t *)psk_key, sizeof(psk_key) - 1); //Set CoAP node ep = coap_new_endpoint(ctx, &serv_addr, COAP_PROTO_UDP); if (!ep) { ESP_LOGE(TAG, "udp: coap_new_endpoint() failed"); goto clean_up; } //Add DTLS node and port if (coap_dtls_is_supported()) { serv_addr.addr.sin6.sin6_port = htons(COAPS_DEFAULT_PORT); ep = coap_new_endpoint(ctx, &serv_addr, COAP_PROTO_DTLS); if (!ep) { ESP_LOGE(TAG, "dtls: coap_new_endpoint() failed"); goto clean_up; } else { ESP_LOGI(TAG, "MbedTLS (D)TLS Server Mode not configured"); } } //Set CoAP resource URI resource = coap_resource_init(coap_make_str_const("light"), 0); if (!resource) { ESP_LOGE(TAG, "coap_resource_init() failed"); goto clean_up; } //Register callback functions for GET and PUT method corresponding to CoAP resource URI coap_register_handler(resource, COAP_REQUEST_GET, esp_coap_get); coap_register_handler(resource, COAP_REQUEST_PUT, esp_coap_put); //Set CoAP GET resource visible coap_resource_set_get_observable(resource, 1); //Add resource to CoAP ctx coap_add_resource(ctx, resource); wait_ms = COAP_RESOURCE_CHECK_TIME * 1000; while (1) { //Wait to receive CoAP data int result = coap_run_once(ctx, wait_ms); if (result < 0) { break; } else if (result && (unsigned)result < wait_ms) { //Decrease waiting time wait_ms -= result; } else { //Reset waiting time wait_ms = COAP_RESOURCE_CHECK_TIME * 1000; } } }
clean_up: coap_free_context(ctx); coap_cleanup();
}

