In development, users can use esp_wifi_set_ps() function to set current Wi-Fi power save type: WIFI_PS_NONE: not using Modem-sleep mode. WIFI_PS_MIN_MODEM: ESP32-C3 wakes up to receive beacon every router DTIM beacon, i.e. 1 router interval. WIFI_PS_MAX_MODEM: ESP32-C3 wakes up periodically to receive beacon. The interval can be configured via the listen_interval parameter in wifi_sta_config_t (unit: in units of the interval time of the router DTIM beacon). The default value is 3, which indicates an interval of 3 router beacons. The code is as follows: typedef enum { WIFI_PS_NONE, /*< No power save*/ WIFI_PS_MIN_MODEM, /*< Minimum modem power saving. In this mode, station wakes up to receive beacon every DTIM period*/ WIFI_PS_MAX_MODEM, /*< Maximum modem power saving. In this mode, interval to receive beacons is determined by the listen_interval parameter in wifi_sta_config_t*/
} wifi_ps_type_t; esp_err_t esp_wifi_set_ps(wifi_ps_type_t type); If type is configured as WIFI_PS_MAX_MODEM, configure the interval listen_interval that ESP32-C3 wakes up to receive beacon as follows: #define LISTEN_INTERVAL 3
